CMAX = 1024

trace("class color")
class color():

    def __init__(self):
        self.set_rgb(0, 0, 0)

    def set_rgb(self, r, g, b):
        # Convert to hsl
        h  = 0
        s  = 0
        sl = 0
        l  = 0
        v  = r
        if g > v:
            v = g
        if b > v:
            v = b
        m = r
        if g < m:
            m = g
        if b < m:
            m = b
        vf = v+m
        l = vf//2
        if l > 0:
            vm = v-m
            if vm > 0:
                if vf <= CMAX:
                    vf = 2*CMAX-vf
                s = CMAX*vm//vf
                if r == v:
                    h = 0*CMAX+CMAX*(g-b)//vm
                elif g == v:
                    h = 2*CMAX+CMAX*(b-r)//vm
                else:
                    h = 4*CMAX+CMAX*(r-g)//vm
            h += CMAX # rotate so R/B either side of 0
            h = h//6
            if h < 0:
                h += CMAX
            elif h >= CMAX:
                h -= CMAX
            # Emphasize low saturation for bright colors (e.g. white)
            sl = CMAX*s//l
        # }
        self.r  = r
        self.g  = g
        self.b  = b
        self.h  = h
        self.sl = sl
        self.l  = l

