class mtab():

    def __init__(self, s):
        self.stage  = s
        self.sz     = sm.sz[s]
        self.nbytes = cube_mtab.mtb[s]
        if hasattr(cube_mtab, "fname"):
            self.fname = cube_mtab.fname
            self.data  = None
            self.foff  = 0
            for i in range(s):
                self.foff += (sm.sz[i]-1)*cube_mtab.mtb[i]
        else:
            self.fname = None
            self.data  = cube_mtab.mtd[s]
        self.fmap = (0, 0, 0, 1, 1, 1, 2, 2, 2, 3, 3, 3, 4, 4, 4, 5, 5, 5)
        self.rmap = (1, 2, -1) * NFACE

    def moves(self, i, f, r):
        mv = 0
        if i > 0:
            d = (i-1)*self.nbytes
            if (self.fname != None):
                fs = open(self.fname, "rb")
                fs.seek(self.foff+d)
                self.data = fs.read(self.nbytes)
                fs.close()
                d = 0
            b = self.data[d]
            d += 1
            if b != 0xFF:
                mvm = self.nbytes*2-1
                f0 = self.fmap[b]
                f[mv] = f0
                r[mv] = self.rmap[b]
                mv += 1
                while (mv < mvm):
                    b >>= 4
                    if (mv & 1) != 0:
                        b = self.data[d]
                        d += 1
                    b0 = b & 0xF
                    if b0 == 0xF:
                        break
                    f0 = self.fmap[b0]
                    r[mv] = self.rmap[b0]
                    if f0 >= f[mv-1]:
                        f0 += 1
                    f[mv] = f0
                    mv += 1

        return mv

